import SearchBar from "../components/SearchBar";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";
import LocationCard from "../components/LocationCard";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import Loading from "../components/Loading";

const useStyles = makeStyles({
	isLoading: {
		margin: 20,
		paddingBottom: 0,
		marginTop: 100,
	},
});

const SearchResult = ({ result, query, isLoading, handleSubmit }) => {
	const classes = useStyles();

	const searchParam = <b>{query}</b>;

	console.log(result);
	return (
		<Container>
			<SearchBar handleSubmit={handleSubmit} />
			{isLoading ? (
				<Typography variant="h4" className={classes.isLoading}>
					Searching for "{searchParam}"
					<Loading />
				</Typography>
			) : (
				<Typography variant="h4" className={classes.isLoading}>
					{result.length === 0
						? `No result found for "${searchParam}"`
						: `Showing results for "${searchParam}"`}
				</Typography>
			)}
			<Grid container>
				{result.map((element, index) => (
					<Grid item xs={12} md={4} lrg={2} key={index}>
						<LocationCard element={element} />
					</Grid>
				))}
			</Grid>
		</Container>
	);
};

export default SearchResult;
